  \"2013-03-16T00:27:27.812241\",\n\t\"name\": \"geology-of-the-memphremagog-quadrangle-and-the-southeastern-portion-of-the-irasburg-quadrangle-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This resource is available as a downloadable
  file, ESRI Service, and as a Web Feature service. Bulletin includes Plate I, Geologic
  Map of the Memphremagog quadrangle and the southeastern portion of the Irasburg
  quadrangle, Vermont. For more information see links provided.nAbstract:Although
  small parts of the area described in this report received  early attention, much
  of the geology remained unknown. The area,  therefore, afforded an opportunity for
  detailed work which would serve  as a beginning in the correlation of Vermont rocks
  with those on the  other side of the International Border in Canada, thus adding
  to the  knowledge of the Appalachian folded belt in this region. A prime consideration
  is the location of the area within a great tectonic are whose  geology is much better
  known to the southwest and northeast than it  is here at the greatest bend. The
  present work might serve as a nucleus  and reference for subsequent geological research
  in the region.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
